import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams } from 'react-router-dom';

const PerfilComercial = () => {

const { id: idProfesional } = useParams();
  
  const [profesional, setProfesional] = useState({});
  console.log(id); 
  useEffect(() => {
    axios.get(`http://localhost:3000/profesional/${id}`)
      .then(response => setProfesional(response.data))
      .catch(error => console.error(error));
  }, [id]);
  if (!profesional) {
    return <div>Cargando...</div>;
  }
  return (
    <div>
      <h2>Perfil de {profesional.nombre}</h2>
      <p>Email: {profesional.email}</p>
      <p>Teléfono: {profesional.telefono}</p>
      <p>Dirección: {profesional.direccion}</p>
      {/* Agrega más campos según sea necesario */}
    </div>
  );
};
export default PerfilComercial;
